import React from 'react'
interface BottonNextProps {
    onNextPage: () => void;
    padding: string;
    children: React.ReactNode;
}
export const BottonNext: React.FC<BottonNextProps> = ({ onNextPage, padding, children}) => {
    return (
        <button className='ButtonNext' onClick={onNextPage} style={{ padding, border:"none" }}>
            {children}
        </button>
    )
}
